import './App.css';
import { HashRouter, Routes, Route } from 'react-router-dom';


function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/">
          <Route index element={null}/>
          <Route path="contact" element={Contact}/>
        </Route>
      </Routes>
    </HashRouter>
  );
}

export default App;
